from django.urls import pathfrom django.contrib.auth import views as auth_viewsfrom .views import ProfileListView, UserListView, UserDeleteViewurlpatterns = [    path('profile/', ProfileListView.as_view(), name='profile'),    path('user-list/', UserListView.as_view(), name='user_list'),    path('user-list/<username>/', UserDeleteView.as_view(), name='delete_user'),    path('password_change', auth_views.PasswordChangeForm, name='password_change'),]